import React from 'react'
import {makeStyles, withStyles} from "@material-ui/core/styles";
import {TextField, Typography, Button, Grid, Box} from "@material-ui/core"
import SendIcon from "@material-ui/icons/Send"
import Navbar from './Navbar';

const useStyles = makeStyles(theme=>({
    form: {
        top: "50%",
        left:"50%",
        transform: "translate(-50%, -50%)",
        position: "absolute"
    },
    button: {
        marginTop: "1rem",
        color: "white",
        borderColor: "white"
    },

}));

const InputField = withStyles({
    root: {
        "& label.Mui-focused":
        {
        color: "white",
        },
        "& label": {
            color: "gray"
        },
        "& .MuiOutlinedInput-root": {
            "& fieldset": {
                borderColor: "gray"
            },
            "&:hover fieldset": {
                borderColor: "gray"
            },
            "&.Mui-focused fieldset": {
                borderColor: "gray"
            }
        }


    },
})(TextField);

const Contacts = () => {
    const classes = useStyles();
  return (
    <>
    <Navbar/>
    <Box component="div">
        <Grid container justify="center">
            <Box component= "form" className = {classes.form}>
                <Typography variant="h5" style={{color: "white", textAlign: "center", textTransform: "uppercase"}}>
                    hire or contact me...
                </Typography>
                <br />
                <InputField fullWidth ={true}label ="Name" variant="outlined" inputProps={{style:{color: "white"}}} margin = "dense" size = "medium"/>
                <br />
                <InputField fullWidth ={true}label ="Email" variant="outlined"inputProps={{style:{color: "white"}}}margin = "dense" size = "medium"/>
                <br />
                <InputField fullWidth ={true}label ="Organization" variant="outlined"inputText={{style:{color: "white"}}} margin = "dense" size = "medium"/>
                <br />
                <Button variant="outlined" className={classes.button}fullWidth={true} endIcon={<SendIcon />}>
                    contact me
                </Button>
            </Box>
        </Grid>
    </Box>
    </>
  )
};

export default Contacts
